          /dxticket:content:
            jcr:primaryType: hippostd:html
            hippostd:content: <p>Bang Bang! Het geluid van een hart dat sneller begint
              te kloppen bij het horen van deze drie namen op een rij. Een triple
              bill die je gemakkelijk de ultieme mash-up van pop, rock, punk en alternative
              kan noemen. Drie rockbands die al jaren hebben gestreden om hun stempel
              neer te zetten op de huidige rockscene, komen samen in de Hella Mega
              Tour om hun rock-krachten te bundelen. Het is Green Day, Fall Out Boy
              en Weezer, het is Hella Mega</p>
