          hippotranslation:locale: en
          /dxticket:content:
            jcr:primaryType: hippostd:html
            hippostd:content: <p>The Stones "keep on rolling" en zijn terug waar ze
              thuishoren, namelijk op tournee door Europa, waar ze spelen voor volle
              stadions met een nieuwe show. Zoals je mag verwachten voor hun zestigste
              verjaardagsfeest, trakteren Mick Jagger, Keith Richards en Ronnie Wood
              hun fans op een unieke setlist, vol met klassiekers zoals ‘Gimme Shelter’,
              ‘Paint It Black’, ‘Jumpin’ Jack Flash’, ‘Tumbling Dice’, ‘(I Can’t Get
              No) Satisfaction’, ‘Start Me Up’ en nog veel meer. SIXTY krijgt bovendien
              een geheel nieuwe productie, inclusief een enorm podium, bijzondere
              lichtshow en dito video ontwerp, allemaal speciaal vervaardigd voor
              deze langverwachte Europese tournee!</p>
          /dxticket:image:
            jcr:primaryType: hippogallerypicker:imagelink
            hippo:docbase: c8f03498-56eb-46c9-83b2-cf014f2e03d7
