          /dxticket:content:
            jcr:primaryType: hippostd:html
            hippostd:content: <p>In 2017 en 2018 gaf Guns N' Roses al spectaculaire
              optredens in het Goffertpark in Nijmegen, maar nu is dus Paradise City
              Groningen aan de beurt! Fans maken zich klaar voor een nostaligsche
              trip down memory lane en rockten mee op hits als 'Sweet Child O' Mine',
              'Welcome to the Jungle' en 'Nightrain'.</p>
